1	Franck BERNARD	TOPO	2014-07-01 00:00:00	Ravine des Colimaçons\nCOUENNE (voies d'une longueur) (équipement sportif), plus de 20 voies, du 5a au 8a (cotations provisoires à confirmer)\nRocher : roche volcanique, 20 m max\nProfil(s) : vertical, dièdre, dalle\nAncrage : type COLLINOX scéllés\nRelais chaînes\nAltitude au pied des voies : 100m\nOrientation(s) : secteur SUD, à l’ombre toute la journée, au vent , le TOP !	DISPONIBLE	COLIMA'100	SUIVRE la falaise jusqu’aux blocs et traverser la ravine, chemin d’accès en face (rubalise).\nATTENTION : restez dans le secteur « DUNES » les autres secteurs sont en cours d’équipement, non sécurisé et très instables, ils ne seront accessibles que par communiqué.	felicite.brunelle42@yahoo.com	35608
2	\N	TOPO	2011-06-01 00:00:00	L’accès se fait par le chemin que l’on emprunte pour accéder aux grandes voies par le haut en rive droite. Ce chemin descend en lacet sous les filaos puis avance droit sur l’arrête. Dès le début de l’arrête un chemin descend sur la droite et longe la paroi (repère : des barreaux permettent de descendre les premiers mètres). La descente se fait à l’aide de main courantes. Prudence et casques nécessaires !	INDISPONIBLE	Face Nord	ATTENTION A VOS LONGUEURS DE CORDES !\nLes sorties par le haut des voies sont INTERDITES (préservation environnementale & danger).\nTopo indicatif\nInfos non garanties	mariehelene.gachet66@mail.org	6977
3	\N	TOPO	2015-09-25 00:00:00	Topo de la voie «La déroute du littotal» du secteur «Pain de sucre» du spot «Cialos»	DISPONIBLE	Pain de sucre	Matériel : corde rappel 40 mini. - 13 dégaines (prévoir longue dégaines pour éviter le tirage)\nOuverture du bas par Manu Salles / Fabrice Bouisset / Pierre Favre - septembre 2015	paola.baume42@seznam.fr	6977
5	\N	TOPO	\N	\N	DISPONIBLE	Ravine des avirons	rectificatif pour les blocs jaunes, oranges et bleu	franck.silvestre43@outlook.com	2626
6	\N	TOPO	\N	Depuis le parking, prendre le sentier qui démarre à la passerelle en métal du radier. Le chemin est plat et bien entretenu.\nLa vallée est le lieu habituel de pâturage des chèvres. Il est conseillé de ne pas rester sous les falaises lors du passage des troupeaux. Chute de pierres possible.\nA bassin Long on peut piquer une tête.\nN’oubliez pas d’emporter avec vous les déchets en partant.	INDISPONIBLE	Bassin Long	GPS : 21°00’34.63’’S 55°17’06.47’’E\nEnsoleillement: AM secteur DOM, PM les autres secteurs\nMatériel: Casque, 50 m de corde, une dizaine de dégaines, serviette et maillot.\nTemps de marche: 10 minutes Téléphones utiles: PGHM : 0262 930930 Pompier, police: 112, 18, 17	eloise.compere45@qq.com	31254
7	\N	TOPO	2011-07-01 00:00:00	\N	INDISPONIBLE	Saint-Pierre	\N	anne.jacquet91@tutanota.com	27307
8	\N	TOPO	\N	Le site est plutôt ventilé et ombragé dans l'ensemble. Quelques 180 passages de tous niveaux. Les blocs de petite et moyenne taille sont très sculptés...	INDISPONIBLE	Grand Étang	ACCES: Rejoindre la d13 dans les hauts de St Leu. Prendre la direction d'Etang st Leu.\nLorsqu'on vient du nord: Le site est au nord d'étang st Leu. Juste avant Ravine Claude.\nLorsqu'on vient du sud: Roulez jusqu'à passer la pancarte barrée d'Etang St Leu (ravine Claude) puis arrêtez vous à la prochaine ravine. Parkings de part et d'autre du pont.\nApproche 10minutes: Marchez sur la route en direction d'Etang st leu (sud) pendant environ 25 mètres jusqu'à une flèche gravée dans le muret. Enjambez le muret pour prendre pied sur une marchette en pierre. Descendre dans le raide sur les marches d'escaliers maison...	yseult.plantier74@hushmail.org	35608
9	\N	TOPO	\N	\N	DISPONIBLE	Grand Étang les Bas	\N	emilie.bauge61@lycos.fr	35608
10	Nicolas Sibuet	TOPO	2013-05-19 00:00:00	Terrain d’aventure. Superbe voie de difficulté abordable très typée montagne (pose de protections, qualité du rocher à surveiller, environnement sauvage). Escalade très variée et agréable (L3 est superbe!). Sortie au sommet d’un pic esthétique avec vue panoramique!	INDISPONIBLE	Cilaos Château Fort	Ouverture : Pascal Colas\nDescente : rappeler dans la voie (4 rappels) Tous les relais sont 3 points reliés avec maillon rapide.\nEquipement : Spits et plaquettes de l’ouverture en très bon état. Tous les maillons ont été rajoutés et sont donc neufs, ainsi que les cordes reliant les points des relais (corde 9mm spéléo) Un piton a été rajouté (4ème point de L2) en raison de la mauvaise qualité du rocher Un spit de 8 a été rajouté au départ de L3 pour éviter une chute sur la vire Un spit de 8 avec maillon rapide ont étés rajoutés au dernier relais pour permettre de rappeler et éviter des frottements agressifs (le relais étant posé « à plat » sur la terrasse). L’équipement de L3 est à complèter par des coinceurs voire des friends (et c’est ça qui la rend encore plus belle!)\nTemps aller : 25 minutes dénivelée aller: +70m/-150m distance aller: un kilomètre ... Temps retour: 30 minutes	marlene.tremaux53@openmailbox.org	6977
11	Eric Poullain	TOPO	2012-10-06 00:00:00	La ravine Bernica recèle de nombreux passages dans tout les niveaux, plutôt dans le 5 et le 6 pour le moment. Attention toutefois les réceptions sont souvent chaotiques et nécessitent un bon agencement de crashpad ainsi que de bons pareurs.\nL’accès peut être assez difficile à trouver dans les premiers mètres tant de nombreuses sentes parcours le plateau bordant la ravine. Il n’est pas facile d’accès pour des enfants (main courante et désescalade).	DISPONIBLE	Ravine Bernica	Accès :\nDepuis le route des Tamarins prenez la sortie “Plateau Caillou”. Après la sortie restez sur la D6 et prenez la déviation de Plateau Caillou. Au rond point allez tout droit en direction de St Gilles les hauts, puis prenez 500 m plus loin la D8 sur votre gauche direction “Bellemène”. Montez sur 900 m et prenez à gauche la D4E, “Bellemène”. Dès que vous aurez passé la ravine Bernica (la première traversée), prenez la route qui descend sur votre gauche (direction “apiculteur”) et garez vous 500 m plus bas, juste avant une nouvelle intersection menant à un apiculteur.\nTrouvez le marquage 50 m en amont (rubalis et / ou peinture) et suivez le jusqu’au bloc ...	ariane.dubos71@qq.com	31254
12	\N	TOPO	\N	Une jolie petite falaise propice à la découverte de l'activité, au milieu d'un verger péi et du coup bien ombragée.\nAttention il s'agit d'une propriété privée et il est FORMELLEMENT INTERDIT de cueillir des fruits. Le non respect de cette règle pourrait entrainer la fermeture du site par le propriétaire.\nLa famille de se dernier tient un gîte à proximité, idéal pour ceux qui cherchent à séjourner dans l'Est (contact ....)	DISPONIBLE	La Renaissance	Accès\n.Depuis la RN1 en venant de St Denis prenez la sortie "Renaissance" (juste après celle de Ste Suzanne). Au rond point prenez de suite à droite, la RD 63, puis de nouveau de suite à droite. 700 m plus loin un embranchement à droite vous amène vers la cascade Niagara. Ne le prenez pas et restez sur votre gauche sur le chemin Renaissance. 500 m plus loin garez vous sur la gauche (des boites aux lettres se trouvent toutes seules sur la droite du chemin, au niveau d'un embranchement en "Y"). Pensez à laisser de la place pour les engins agricoles ! Remonter le chemin en direction de la falaise (difficilement visible). La partie équipée se trouve sur votre gauche en montant. Comptez 5 mn.\nEquipement L'équipement (broches et relais chainés) date de 2012/2013. Le site a été équipé par le club Est'Kalad et le Comité Régional FFME.\nMatériel nécessaire Corde 20m, 8 degaines, casques.\nEnsoleillement Grâce au verger le site est à l'ombre la plus grande partie de la journée.	josselin.lajoie75@yandex.fr	2548
13	F. Baux	TOPO	2014-12-18 00:00:00	Le site propose quelques blocs interressants malgré un rocher agressif. La roche paté, véritable promontoire visible de Saint Leu permet de grimper avec l'océan en toile de fond. Le bastion se dresse tel une pyramide au milieu de nulle part...	INDISPONIBLE	Roche pâté	Accès: Depuis l'entrée nord de Saint Leu. Empruntez le chemin surprise. Montez les lacets et tournez à la deuxième à droite, chemin batterie. Descendez jusqu'au grand parking devant les canons.\nDu parking (10 min): emprunte: le sentier pavé qui monte. A la patte d'oie, prenez la  sente entre les branches sur la droite. Marchez dans la fôret puis descendre dans un lit de ravine étroit. Le secteur poudding est à votre gauche.	yolande.dumont11@qq.com	35608
14	\N	TOPO	2011-05-01 00:00:00	\N	DISPONIBLE	Colimaçons	\N	neo.bethune11@yahoo.fr	35608
4	Olivier GAMBIN	TOPO	\N	Un petit secteur avec quelques beaux passages. Idéal pour ceux qui habitent dans le coin ! Il n’y a pas de marche d’approche et vous pouvez y aller en famille. Des secteurs à l’ombre pour grimper tout au long de la journée.	INDISPONIBLE	Ravine Claude	Profil de difficulté :\r\n- 2 à 3 (orange) : 29 blocs\r\n- 4 à 5a (bleu) : 34 blocs\r\n- 5b à 6a (rouge) : 21 blocs\r\n- 6b à 7a : 17 blocs\r\n- 7b et plus (blanc) : 3 blocs\r\nAccès :\r\nIl faut gagner la D13 qui parcours les hauts de St Leu. La ravine se trouve juste au nord du quartier “L’étang St Leu”, cf la carte. Aire de stationnement au niveau du panneau indiquant “Etang St Leu”	fabien.poulin52@protonmail.fr	35608
15	Inconnu	TOPO	2020-02-13 00:00:00	Description	DISPONIBLE	Topo test	Remarque	segolene.deniau6@lycos.fr	17120
