5	Depuis le parking, prendre le sentier qui démarre à la passerelle en métal du radier. Le chemin est plat et bien entretenu.\nLa vallée est le lieu habituel de pâturage des chèvres. Il est conseillé de ne pas rester sous les falaises lors du passage des troupeaux. Chute de pierres possible.\nA bassin Long on peut piquer une tête.\nN’oubliez pas d’emporter avec vous les déchets en partant.	Bassin Long	GPS : 21°00’34.63’’S 55°17’06.47’’E\nEnsoleillement: AM secteur DOM, PM les autres secteurs\nMatériel: Casque, 50 m de corde, une dizaine de dégaines, serviette et maillot.\nTemps de marche: 10 minutes Téléphones utiles: PGHM : 0262 930930 Pompier, police: 112, 18, 17	t	31254	la_reunion_bassin_long.png
