7	Le site est plutôt ventilé et ombragé dans l'ensemble. Quelques 180 passages de tous niveaux. Les blocs de petite et moyenne taille sont très sculptés...	Grand Étang	ACCES: Rejoindre la d13 dans les hauts de St Leu. Prendre la direction d'Etang st Leu.\nLorsqu'on vient du nord: Le site est au nord d'étang st Leu. Juste avant Ravine Claude.\nLorsqu'on vient du sud: Roulez jusqu'à passer la pancarte barrée d'Etang St Leu (ravine Claude) puis arrêtez vous à la prochaine ravine. Parkings de part et d'autre du pont.\nApproche 10minutes: Marchez sur la route en direction d'Etang st leu (sud) pendant environ 25 mètres jusqu'à une flèche gravée dans le muret. Enjambez le muret pour prendre pied sur une marchette en pierre. Descendre dans le raide sur les marches d'escaliers maison...	t	35608	la_reunion_grand_etang.png
