9	Terrain d’aventure. Superbe voie de difficulté abordable très typée montagne (pose de protections, qualité du rocher à surveiller, environnement sauvage). Escalade très variée et agréable (L3 est superbe!). Sortie au sommet d’un pic esthétique avec vue panoramique!	Cilaos Château Fort	Ouverture : Pascal Colas\nDescente : rappeler dans la voie (4 rappels) Tous les relais sont 3 points reliés avec maillon rapide.\nEquipement : Spits et plaquettes de l’ouverture en très bon état. Tous les maillons ont été rajoutés et sont donc neufs, ainsi que les cordes reliant les points des relais (corde 9mm spéléo) Un piton a été rajouté (4ème point de L2) en raison de la mauvaise qualité du rocher Un spit de 8 a été rajouté au départ de L3 pour éviter une chute sur la vire Un spit de 8 avec maillon rapide ont étés rajoutés au dernier relais pour permettre de rappeler et éviter des frottements agressifs (le relais étant posé « à plat » sur la terrasse). L’équipement de L3 est à complèter par des coinceurs voire des friends (et c’est ça qui la rend encore plus belle!)\nTemps aller : 25 minutes dénivelée aller: +70m/-150m distance aller: un kilomètre ... Temps retour: 30 minutes	f	6977	la_reunion_cilaos_chateau_fort.png
