12	Un petit site de grimpe dans les hauts, quelques belles lignes en 6, en 7 et un 8 vieille école. Des voies en 4 et 5 sont en train de voir le jour.\nComme tout les sites de grimpe  un  peu ombragés ou dans une ravine à La Réunion ne pas oublier l'anti-moustique !\nSecteur 400 (altitude) car un autre tout petit secteur (secteur 600) se trouve bien plus haut dans la ravine et un autre devrait voir le jour plus bas (futur secteur 300) . La falaise est là, n'attendant que du temps libre d'équipeur ...	Falaise de 3 bassins	Coordonnées géodésiques : 21°06'10.94"S , 55°16'39.94" E	t	31254	la_reunion_falaise_3_bassins.png
13	La ravine Bernica recèle de nombreux passages dans tout les niveaux, plutôt dans le 5 et le 6 pour le moment. Attention toutefois les réceptions sont souvent chaotiques et nécessitent un bon agencement de crashpad ainsi que de bons pareurs.\nL’accès peut être assez difficile à trouver dans les premiers mètres tant de nombreuses sentes parcours le plateau bordant la ravine. Il n’est pas facile d’accès pour des enfants (main courante et désescalade).	Ravine Bernica	Accès :\nDepuis le route des Tamarins prenez la sortie “Plateau Caillou”. Après la sortie restez sur la D6 et prenez la déviation de Plateau Caillou. Au rond point allez tout droit en direction de St Gilles les hauts, puis prenez 500 m plus loin la D8 sur votre gauche direction “Bellemène”. Montez sur 900 m et prenez à gauche la D4E, “Bellemène”. Dès que vous aurez passé la ravine Bernica (la première traversée), prenez la route qui descend sur votre gauche (direction “apiculteur”) et garez vous 500 m plus bas, juste avant une nouvelle intersection menant à un apiculteur.\nTrouvez le marquage 50 m en amont (rubalis et / ou peinture) et suivez le jusqu’au bloc ...	t	31254	la_reunion_ravine_bernica.png
