1	Ravine des Colimaçons\r\nCOUENNE (voies d'une longueur) (équipement sportif), plus de 20 voies, du 5a au 8a (cotations provisoires à confirmer)\r\nRocher : roche volcanique, 20 m max\r\nProfil(s) : vertical, dièdre, dalle\r\nAncrage : type COLLINOX scéllés\r\nRelais chaînes\r\nAltitude au pied des voies : 100m\r\nOrientation(s) : secteur SUD, à l’ombre toute la journée, au vent , le TOP !	COLIMA'100	SUIVRE la falaise jusqu’aux blocs et traverser la ravine, chemin d’accès en face (rubalise).\r\nATTENTION : restez dans le secteur « DUNES » les autres secteurs sont en cours d’équipement, non sécurisé et très instables, ils ne seront accessibles que par communiqué.	t	35608	la_reunion_saint_leu.png
14	Une jolie petite falaise propice à la découverte de l'activité, au milieu d'un verger péi et du coup bien ombragée.\nAttention il s'agit d'une propriété privée et il est FORMELLEMENT INTERDIT de cueillir des fruits. Le non respect de cette règle pourrait entrainer la fermeture du site par le propriétaire.\nLa famille de se dernier tient un gîte à proximité, idéal pour ceux qui cherchent à séjourner dans l'Est (contact ....)	La Renaissance	Accès\n.Depuis la RN1 en venant de St Denis prenez la sortie "Renaissance" (juste après celle de Ste Suzanne). Au rond point prenez de suite à droite, la RD 63, puis de nouveau de suite à droite. 700 m plus loin un embranchement à droite vous amène vers la cascade Niagara. Ne le prenez pas et restez sur votre gauche sur le chemin Renaissance. 500 m plus loin garez vous sur la gauche (des boites aux lettres se trouvent toutes seules sur la droite du chemin, au niveau d'un embranchement en "Y"). Pensez à laisser de la place pour les engins agricoles ! Remonter le chemin en direction de la falaise (difficilement visible). La partie équipée se trouve sur votre gauche en montant. Comptez 5 mn.\nEquipement L'équipement (broches et relais chainés) date de 2012/2013. Le site a été équipé par le club Est'Kalad et le Comité Régional FFME.\nMatériel nécessaire Corde 20m, 8 degaines, casques.\nEnsoleillement Grâce au verger le site est à l'ombre la plus grande partie de la journée.	f	2548	la_reunion_la_renaissance.png
15	Le site propose quelques blocs interressants malgré un rocher agressif. La roche paté, véritable promontoire visible de Saint Leu permet de grimper avec l'océan en toile de fond. Le bastion se dresse tel une pyramide au milieu de nulle part...	Roche pâté	Accès: Depuis l'entrée nord de Saint Leu. Empruntez le chemin surprise. Montez les lacets et tournez à la deuxième à droite, chemin batterie. Descendez jusqu'au grand parking devant les canons.\nDu parking (10 min): emprunte: le sentier pavé qui monte. A la patte d'oie, prenez la  sente entre les branches sur la droite. Marchez dans la fôret puis descendre dans un lit de ravine étroit. Le secteur poudding est à votre gauche.	f	35608	la_reunion_roche_pate.png
