48	Une top ligne avec de magnifiques longueurs. Une des plus longue grimpe de l'île...\nVoici donc une topo "2 nd jet" de la voie lactée partie basse. La partie haute est présente dans le Topo papier de P. Grandrémy. La cotation max de la partie haute (L9 à L13) est 6b+.\nLa cotation max de la voie est 7b (L7) en libre, ou 6c en faisant le 7b en artif' (points suffisamment proches pour pouvoir tirer auclou).	\N	La voie lactée	\N	Accés : Je conseille l'accés par  l'arrête "faut y croire", celle que l'on prend pour rejoindre les voitures aprés avoir fait le canyon de fleurs jaunes. A mon dernier passage elle était équipée à demeure de cordes fixes. Avec un baudrier et 2 longes qui vont bien, un casque sur la tête ....pas trop de soucis pour descendre par là. Attention  à ne pas balancer  de pierres sur le mec qui vous précéde et se trouve en contrebas ... sinon vous n'aurez plus d'assureur pour la voie !\nQuand vous arrivez au départ de "parfum des mers du sud" vous prolongez votre descente le long du canyon jusqu'à trouver le départ ... je n'ai pas de point de repère à vous donner. De toute manière une seule voie part de la zone.\nIl est tout a fait possible de ne faire que les 4 premières longueurs et rester ainsi dans le 5c/6a. Ces longueurs sont vraiment belles, surtout L2.\nOn peut descendre en rappel, de R7 à R6, de R6 à R4, de R4 à R3 à R2 jusqu'au sol. Attention corde de 70 m obligatoire, certains rappels font 35 m !!!!	10	piton_de_sucre_voie_lactee.png	6
